script: |
  super -f text -I q7596.spq | sort > q7596.out

inputs:
  - name: q7596.spq
    data: |
      SELECT DISTINCT col2 + - col0 + col2 * col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE 18 * - + ( - - 37 ) BETWEEN + + ( + + 67 ) AND - col1 + ( + + col2 );
  - name: tab1

outputs:
  - name: q7596.out
    data: |
